import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import "../../styles/auth.css";

const Register = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    firstName: "",
    middleName: "",
    lastName: "",
    contact: "",
    address: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  const [passwordError, setPasswordError] = useState("");

  // Handle Input Change
  const handleChange = (e) => {
    const { name, value } = e.target;

    setFormData({
      ...formData,
      [name]: value,
    });

    // Real-time password validation
    if (
      (name === "password" || name === "confirmPassword") &&
      formData.confirmPassword !== ""
    ) {
      if (name === "confirmPassword" && value !== formData.password) {
        setPasswordError("Passwords do not match ❌");
      } else if (name === "password" && formData.confirmPassword !== value) {
        setPasswordError("Passwords do not match ❌");
      } else {
        setPasswordError("");
      }
    }
  };

  // Handle Form Submit
  const handleSubmit = (e) => {
    e.preventDefault();

    if (formData.password !== formData.confirmPassword) {
      setPasswordError("Passwords do not match ❌");
      return;
    }

    alert("Registration successful!");
    navigate("/student-dashboard");
  };

  return (
    <div className="auth-wrapper">
      {/* ===== LEFT SECTION ===== */}
      <div className="auth-left">
        <h1>
          Join <span>BlueSheep University</span>
        </h1>
        <p>Sign up and start your journey to excellence today.</p>
        <img
          src="https://cdn-icons-png.flaticon.com/512/9044/9044123.png"
          alt="Register Illustration"
          className="auth-illustration"
        />
      </div>

      {/* ===== RIGHT SECTION ===== */}
      <div className="auth-right">
        <div className="auth-box">
          <h2>Create Your Account</h2>
          <p className="subtitle">Please fill in the details to get started.</p>

          <form onSubmit={handleSubmit}>
            {/* Full Name Fields */}
            <div className="name-fields">
              <input
                type="text"
                name="firstName"
                placeholder="First Name *"
                value={formData.firstName}
                onChange={handleChange}
                required
              />
              <input
                type="text"
                name="middleName"
                placeholder="Middle Name (Optional)"
                value={formData.middleName}
                onChange={handleChange}
              />
              <input
                type="text"
                name="lastName"
                placeholder="Last Name *"
                value={formData.lastName}
                onChange={handleChange}
                required
              />
            </div>

            {/* Contact & Address */}
            <input
              type="text"
              name="contact"
              placeholder="Contact Number"
              value={formData.contact}
              onChange={handleChange}
              required
            />

            <input
              type="text"
              name="address"
              placeholder="Address"
              value={formData.address}
              onChange={handleChange}
              required
            />

            {/* Email */}
            <input
              type="email"
              name="email"
              placeholder="Email Address"
              value={formData.email}
              onChange={handleChange}
              required
            />

            {/* Password Fields */}
            <input
              type="password"
              name="password"
              placeholder="Password"
              value={formData.password}
              onChange={handleChange}
              required
            />

            <input
              type="password"
              name="confirmPassword"
              placeholder="Confirm Password"
              value={formData.confirmPassword}
              onChange={handleChange}
              required
            />

            {passwordError && (
              <p className="error-message">{passwordError}</p>
            )}

            <button type="submit" className="primary-btn">
              Create Account
            </button>
          </form>

          <p className="redirect-text">
            Already have an account?{" "}
            <Link to="/login" className="link">
              Login
            </Link>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Register;
